/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import "./Shared.css";
import "./Invest.css";

export const Invest: React.FC = () => {
    return (
        <div className="main">
            <h1 className="intro">We are looking for partners</h1>
            <img src="./images/invest.png" />
              <p>
                  As long as there’s an “/invest” page on our site, we’re
                  bootstrapping, eating pasta, and looking for investment. As
                  well as looking for wise, patient board members, who share
                  our moral values and goals and want to help us develop
                  powerful, novel digital therapeutics for the world.
              </p>
              <p>
                  If you’re interested in making money and mental health,
                  let’s talk.
              </p>
              <p>invest@csd.red</p>
              <h3>Would you like to know more?</h3>
              <p>
                  <a href="https://mother.technology/files/Mother.pitchdeck_s.pdf">
                      Our pitch deck (pdf).
                  </a>
              </p>
              <h2>Hard work, easy.</h2>
        </div>
    );
};
